// src/App.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from '../my-app/src/pages/Home';
import TheIdea from '../my-app/src/pages/TheIdea';
import TheWhy from '../my-app/src/pages/TheWhy';
import TheCreator from '../my-app/src/pages/TheCreator';
import './index.css';
import './App.css';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/theidea" element={<TheIdea />} />
      <Route path="/thewhy" element={<TheWhy />} />
      <Route path="/thecreator" element={<TheCreator />} />
    </Routes>
  );
}

export default App;
